import React, {Component} from 'react';


class Options extends Component {
  render() {
    return (
    <div>
        <a href="#" onClick={this.props.on_click_manage_users}>
            Manage Users
        </a>
        <hr></hr>
        
    </div>
    );
    }
}


export default Options;
